import React from 'react';

const MyComponent = props => {
    const {name, children} = props;
  return (
    <div>
      Hello, my name is {props.name} <br />
      The children is {props.children}
    </div>
  );
};

MyComponent.defaultProps = {
  name: 'basic name'
};

export default MyComponent;
